Dornier 17 : The Fall and Rise of a German Bomber

War Documentary hosted by Nick Higham, published by BBC in 2013 - English narration


Information
------------------------------

The Dornier Do-17 aircraft was shot down off the Kent coast more than 70 years ago during the Battle of Britain. Believed to be the only intact example of its kind in the world, it has lain in 50ft (15m) of water on the Goodwin Sands. Originally designed as a fast reconnaissance aircraf, the Dornier had been converted by the Luftwaffe in the mid-1930s into a medium bomber. The aircraft was a mainstay of the German bomber fleets during the Battle of Britain in 1940. The wreck is believed to be aircraft call-sign 5K-AR, shot down on 26 August that year at the height of the battle. Now the only surviving German second world war Dornier Do 17 bomber is to be raised from the English Channel.

Reporter : Nick Higham
Producer : Peter Machin
